const percentChange2020 = (county) =>
  (county.pop_2020 - county.pop_2010) / county.pop_2010;
const percentChange2010 = (county) =>
  (county.pop_2010 - county.pop_2000) / county.pop_2000;
const percentChange2000 = (county) =>
  (county.pop_2000 - county.pop_1990) / county.pop_1990;

